window.bookSummaryJSON = "<p>With Evelyn unconscious, it's up to the rest of the team to keep Chicago from breaking out into chaos.</p> <p>Witches, wolves, and vampires are at each other's throats. Demons are slipping through the barrier and the dead are piling up. It's up to Astrid and Ranulf to keep Chicago from erupting into war.</p> <p>With Evelyn getting weaker by the hour, Falk and Rina race against time and magic to find the only way to save her. But the storm that got away from Evelyn has gotten larger, spreading across the united states grounding every flight. Will they make it in time to save her?</p>"; 
